        string AccountName;
        Decimal Amount = 0;
        Decimal BeforeFreePoint = 0;
        DateTime ConfirmDate;
        for (int i = 0; i < datas.Count; i++)
        {
            var data = datas[i];

            var month = data["日期"].ToString().Split('/')[0];
            var day = data["日期"].ToString().Split('/')[1];
            var h = data["时间点"].ToString().Split('.')[0];
            var n = data["时间点"].ToString().Split('.')[1];
            var s = data["时间点"].ToString().Split('.')[2];
            Amount = Decimal.Parse(data["金额"].ToString());
            if (data["提现/充值"].ToString() == "充值")
            {
                PaymentFlowType = 3;
                PaymentType = 0;
                 BankName="";
                 BankNumber="";
                 AccountName="";
            }
            else
            {
                PaymentFlowType = 5;
                PaymentType = 1;
                BankName = data["银别"].ToString();
                BankNumber = data["账户"].ToString();
                AccountName = data["户名"].ToString();

            }

            PaymentSerial = Guid.NewGuid().ToString("N");
            ConfirmDate = new DateTime(2022, int.Parse(month), int.Parse(day), int.Parse(h), int.Parse(n), int.Parse(s));
            InsertUserAccountPayment(PaymentSerial,forUserAccountID, forCompanyID, PaymentType, PaymentFlowType, Amount, BeforeFreePoint, ConfirmDate,BankName,BankNumber,AccountName);

             BeforeFreePoint += Amount;

        }

    }
    public static int InsertUserAccountPayment(string PaymentSerial,int forUserAccountID, int forCompanyID, int PaymentType,int PaymentFlowType, decimal Amount, decimal BeforeValue, DateTime ConfirmDate,string BankName,string BankNumber,string AccountName)
    {
        string SS;
        System.Data.SqlClient.SqlCommand DBCmd;

        SS = " INSERT INTO UserAccountPayment (PaymentSerial,forUserAccountID, forCompanyID, PaymentType, PaymentProviderCode, PaymentFlowType, Amount,UserAmount, BeforeValue,AccountingAmount,CurrencyType,BankName,BankNumber,AccountName)" +
                                               "VALUES(@PaymentSerial,@forUserAccountID, @forCompanyID, @PaymentType, @PaymentProviderCode, @PaymentFlowType, @Amount,@Amount, @BeforeValue,@AccountingAmount,@CurrencyType,@BankName,@BankNumber,@AccountName)";
        DBCmd = new System.Data.SqlClient.SqlCommand();
        DBCmd.CommandText = SS;
        DBCmd.CommandType = System.Data.CommandType.Text;
        DBCmd.Parameters.Add("@PaymentSerial", System.Data.SqlDbType.VarChar).Value = PaymentSerial;
        DBCmd.Parameters.Add("@forUserAccountID", System.Data.SqlDbType.Int).Value = forUserAccountID;
        DBCmd.Parameters.Add("@forCompanyID", System.Data.SqlDbType.Int).Value = forCompanyID;
        DBCmd.Parameters.Add("@PaymentType", System.Data.SqlDbType.Int).Value = PaymentType;
        DBCmd.Parameters.Add("@PaymentProviderCode", System.Data.SqlDbType.VarChar).Value = "GPay";
        DBCmd.Parameters.Add("@PaymentFlowType", System.Data.SqlDbType.Int).Value = PaymentFlowType;
        DBCmd.Parameters.Add("@Amount", System.Data.SqlDbType.Decimal).Value = Amount;
        DBCmd.Parameters.Add("@UserAmount", System.Data.SqlDbType.Decimal).Value = Amount;
        DBCmd.Parameters.Add("@BeforeValue", System.Data.SqlDbType.Decimal).Value = BeforeValue;
        DBCmd.Parameters.Add("@AccountingAmount", System.Data.SqlDbType.Decimal).Value = BeforeValue;
        DBCmd.Parameters.Add("@FinishedDate", System.Data.SqlDbType.DateTime).Value = ConfirmDate;
        DBCmd.Parameters.Add("@CreateDate", System.Data.SqlDbType.DateTime).Value = ConfirmDate;
        DBCmd.Parameters.Add("@CurrencyType", System.Data.SqlDbType.VarChar).Value = "CNY";
        DBCmd.Parameters.Add("@BankName", System.Data.SqlDbType.NVarChar).Value = BankName;
        DBCmd.Parameters.Add("@BankNumber", System.Data.SqlDbType.VarChar).Value = BankNumber;
        DBCmd.Parameters.Add("@AccountName", System.Data.SqlDbType.NVarChar).Value = AccountName;
        return DBAccess.ExecuteDB("", DBCmd);
    }

